der, Anub'Arak, were finally defeated by the Lich King many years ago. It is said he was the most loyal of Anub'Arak's commanders.",npcID=15956,u=30,g={crit(5100,{achID=562,awp=30002,u=30}),crit(7146,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1602,{awp=30002,lore="A botanist in life, breeder and caretaker of arachnids in death, she oversees the spider wing, developing the most potent of poisons for the Lich King.",npcID=15953,u=30,g={ach(1997,{awp=30002,u=30,g={crit(7532,{achID=2137,awp=30002,id=11,u=30})}}),crit(5101,{achID=562,awp=30002,u=30}),crit(7147,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1603,{awp=30002,lore="Born deep within the mountains of Northrend many ages ago, she was captured within the dread citadel Naxxramas, where she gives birth to her brood, feeding them the corpses of all who dare venture too deeply into Naxxramas.",npcID=15952,u=30,g={ach(1858,{awp=30002,u=30,g={crit(7529,{achID=2137,awp=30002,id=4,u=30})}}),crit(5102,{achID=562,awp=30002,u=30}),crit(7148,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}})}}),h(-81,{awp=30002,u=30,g={e(1604,{awp=30002,lore="Responsible for the creation of the process that distills the souls of the living and places them within the cold cage of undeath, Noth was observed to be refining this process even now.",npcID=15954,u=30,g={crit(5104,{achID=566,awp=30002,u=30}),crit(7153,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1605,{awp=30002,lore="The mastermind behind the plague cauldrons that turned the wilderness of Azeroth into the Plaguelands. It is said that Heigan has rigged the very walls and floors of Naxxramas itself with a vast array of traps, which he can trigger at will.",npcID=15936,u=30,g={ach(1996,{awp=30002,u=30,g={crit(7531,{achID=2137,awp=30002,id=5,u=30})}}),crit(5112,{achID=566,awp=30002,u=30}),crit(7154,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30}),s(172363,39248,{awp=30002,b=1,description="This item was originally available in Naxxramas 10, but after H+ was introduced to Wrath Classic, it was removed.",f=6,isBounty=1,lvl=80,modID=1,q=4,rwp=30401,u=2})}}),e(1606,{awp=30002,lore="The hideous result of fusing the living plague of the Plaguelands with the bog beasts of Azeroth, Loatheb is said to control the power of healing itself.",npcID=16011,u=30,g={ach(2182,{awp=30002,u=30}),crit(5113,{achID=566,awp=30002,u=30}),crit(7155,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}})}}),h(-80,{awp=30002,u=30,g={e(1607,{awp=30002,lore="Kel'Thuzad's appointed trainer of all death knights. It is said that his own technique is so potent, only a disciple of his could possibly withstand his might.",npcID=16061,u=30,g={crit(6429,{achID=568,awp=30002,u=30}),crit(7156,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1608,{awp=30002,lore="A master of necromancy and conjuration, Gothik is said to be able to beckon forth legions of the undead at a moment's notice. It is with his guidance that even the weakest of Death Knights can raise the dead.",npcID=16060,u=30,g={crit(6431,{achID=568,awp=30002,u=30}),crit(7157,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1609,{awp=30002,crs={16063,16064,16065,30549},lore="The most powerful death knights within Naxxramas are the four horsemen. They represent the pinnacle of Kel'Thuzad's guard. The first, Thane Korth'azz, holds the power of flame. The next, Lady Blaumeux, calls forth the power of shadows, drawing the souls of the living into the voracious embrace. Sir Zeliek, a paladin in life, so strong in his faith, that even in undeath, the power of the light still heeds his call, smiting his foes in battle. The final death knight, Lord Mograine, was the finest warrior that the death knights had ever seen. However, after the events of Azeroth, he vanished without a trace. Kel'Thuzad has appointed Baron Rivendare in his place.",providers={{"o",193426}},u=30,g={ach(2176,{awp=30002,u=30,g={crit(7602,{achID=2137,awp=30002,id=3,u=30})}}),crit(7805,{achID=568,awp=30002,u=30})}})}}),h(-79,{awp=30002,u=30,g={e(1610,{awp=30002,lore="When word of his existence first reached the ears of the Brotherhood, none believed the tales of an abomination with such immense speed and strength. Fewer still believed it when he fell the first time... Patchwerk want to play!",npcID=16028,u=30,g={ach(1856,{awp=30002,u=30,g={crit(7530,{achID=2137,awp=30002,id=14,u=30})}}),crit(5110,{achID=564,awp=30002,u=30}),crit(7149,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1611,{awp=30002,lore="The first of what was to be an army of flesh giants. It carried the plague slime of Naxxramas within its body, injecting the living ooze into the bodies of its foe. The recipient of this foul injection would usually flee to his allies, bringing them down with him.",npcID=15931,u=30,g={crit(5114,{achID=564,awp=30002,u=30}),crit(7150,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1612,{awp=30002,lore="The foul plague-dog of Naxxramas, was said to have an appetite so voracious that even the living were not enough to satisfy his hunger. Feugen was said to feed him an army of zombies daily, recycling the remains of undead too weak to use in combat.",npcID=15932,u=30,g={crit(6416,{achID=564,awp=30002,u=30}),crit(7151,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1613,{awp=30002,lore="Built from the flesh of women and children, it is said that their souls are fused together - eternally bound within that foul prison of flesh.",npcID=15928,u=30,g={ach(2178,{awp=30002,u=30,g={crit(7606,{achID=2137,awp=30002,id=8,u=30})}}),ach(2180,{awp=30002,u=30}),crit(5119,{achID=564,awp=30002,u=30}),crit(7152,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}})}}),h(-82,{awp=30002,u=30,g={e(1614,{awp=30002,lore="Once a noble blue dragon within the mountains of Northrend, Sapphiron was slain by Arthas during his campaign thr