ramas within its body, injecting the living ooze into the bodies of its foe. The recipient of this foul injection would usually flee to his allies, bringing them down with him.",npcID=15931,u=30,g={crit(6406,{achID=565,awp=30002,u=30}),crit(7163,{achID=579,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_25M,u=30})}}),e(1612,{awp=30002,lore="The foul plague-dog of Naxxramas was said to have an appetite so voracious that even the living were not enough to satisfy his hunger. Feugen was said to feed him an army of zombies daily, recycling the remains of undead too weak to use in combat.",npcID=15932,u=30,g={crit(5124,{achID=565,awp=30002,u=30}),crit(7164,{achID=579,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_25M,u=30})}}),e(1613,{awp=30002,lore="Built from the flesh of women and children, it is said that their souls are fused together - eternally bound within that foul prison of flesh.",npcID=15928,u=30,g={ach(2179,{awp=30002,u=30,g={crit(7607,{achID=2138,awp=30002,id=9,u=30})}}),ach(2181,{awp=30002,u=30}),crit(5134,{achID=565,awp=30002,u=30}),crit(7165,{achID=579,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_25M,u=30})}})}}),h(-82,{awp=30002,u=30,g={e(1614,{awp=30002,lore="Once a noble blue dragon within the mountains of Northrend, Sapphiron was slain by Arthas during his campaign through the frozen north. Resurrected to serve him, Sapphiron guards Kel'Thuzad's lair eternally, awaiting those who would dare trespass upon his master.",npcID=15989,u=30,g={ach(573,{awp=30002,u=30}),ach(2147,{awp=30002,u=30,g={crit(7569,{achID=2138,awp=30002,id=12,u=30})}}),crit(7171,{achID=579,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_25M,u=30})}}),e(1615,{awp=30002,lore="He serves the Lich King without question, a necromancer of great prowess in life, turned to a master of necromancy after his death. It is said he is the most loyal of the Lich King's subjects.",npcID=15990,u=30,g={ach(1402,{rwp=40003,u=2,g={title(90,{rwp=40003,u=2})}}),ach(575,{awp=30002,u=30}),ach(2185,{awp=30002,crs={16428},u=30,g